                    <textarea id="log"></textarea>

    <script type="text/javascript">
        //This script will overwrite attempts to navigate back and forth with the state of the current page
        history.pushState(null, null, document.URL);
        window.addEventListener('popstate', function () {
            history.pushState(null, null, document.URL);
        });
        window.onunload = function () { null };

        function writeLog(title, item) {
            var _text = '';
            var _log = document.getElementById('log');
            if (typeof title === 'string')
                _text = title;
            else
                _text = JSON.stringify(title);

            var _item = '';
            if (item != null) {
                if (typeof item === 'string')
                    _item = ': ' + item;
                else
                    _item = ': ' + JSON.stringify(item);
            }

            _log.innerHTML = _log.innerHTML + '\r\n' + _text + _item;
            if (item)
                console.log(_text, item);
            else
                console.log(_text);
        }

        function page_Init(_hasServiceWorker) {
            head.load([
                '/lib/jquery/jquery-1.12.4.min.js',
                '/lib/bootstrap-3.3.7/css/bootstrap.min.css',
                '/lib/bootstrap-3.3.7/css/bootstrap-theme.min.css',
                '/lib/bootstrap-3.3.7/js/bootstrap.min.js',
                '/lib.css',
                '/app.css',
                '/app.js'], function () {


                    writeLog('Completed load library base: jquery, bootstrap ...');
                    api.app.Init(head, writeLog, _hasServiceWorker);
                });
        }

        // Once the Service Worker is activated, init()
        if ('serviceWorker' in navigator) {
            navigator.serviceWorker.getRegistration().then(function (registration) {
                if (!registration) {
                    writeLog('[INDEX-WORKER] The application did not install service worker');

                    navigator.serviceWorker.register('worker.js', { scope: '.' });
                    navigator.serviceWorker.ready.then(function () {
                        writeLog('[INDEX-CACHE] The Service Worker was successfully installed!');
                        // Preferably, display a message asking the user to reload...
                        //setTimeout(function () { location.reload(); }, 10);


                        page_Init(true);
                    });
                    return;
                }

                //if (sessionStorage['worker'] == 'true') {
                //    writeLog('[INDEX-WORKER] The application installed service worker');
                //    return;
                //}

                registration.unregister().then(function () {
                    writeLog('[INDEX-WORKER] The application has been uninstalled service worker');
                    sessionStorage['worker'] = 'true';
                    setTimeout(function () { location.reload(); }, 10);
                }).catch(function (error) {
                    writeLog('[INDEX-WORKER] Error while uninstalling the service worker:');
                    writeLog(error.message);
                });
            });
        } else
            page_Init(false);
    </script>
